import React, { useState, useEffect } from "react";
import PropTypes from "prop-types";

function UnitDisplay(props) {
  const displayUnits = (props) => {
    const { units } = props;

    if (units.length > 0) {
      return Object.keys(units).map((unit) => {
        return (
          <div className="unit">
            <h3 className="description">{unit.unit_description}</h3>
            <p className="bedrooms">{unit.num_of_bedrooms}</p>
          </div>
        );
      });
    } else {
      return <h3>No units</h3>;
    }
  };

  return <>{displayUnits(props)}</>;
}

export default UnitDisplay;
